<html lang="en"><head>

    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Nunito+Sans:ital,wght@0,200;0,300;0,400;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,600;1,700;1,800;1,900&display=swap');
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Nunito Sans', sans-serif;
        }
        body {
            background: url('Shiptime_background.png') no-repeat top center;
            background-size: cover;
            width: 100vw;
            height: 100vh;
            overflow: hidden;
        }
        svg {
            transform: translate(840px, 160px);
            overflow: visible!important;
        }
        .font_bold {
            font-weight: 800;
        }
        .phone_elem {
            animation: PhonePopup forwards 0.5s linear;
            animation-delay: 0.5s;
            transform: translateY(100%);
            transition: all 0.5s ease-in;
        }
        @keyframes PhonePopup {
            0% {
                transform: translateY(100%);
            }
            100% {
                transform: translateY(-10%);
            }
        }
        
        .card_elem_wrap {
            overflow: hidden;
            transform: translateY(-10%);
        }
        .card_elem {
            animation: CardPopup forwards 0.5s linear;
            animation-delay: 1s;
            transform: rotateY(90deg);
            transform-origin: right;
            transform-box: fill-box;
            transition: all 0.5s ease-in;
        }
        
        @keyframes CardPopup {
            0% {
                transform: rotateY(90deg);
            }
            100% {
                transform: rotateY(0deg);
            }
        }
    
        .purolator_carrier, .canada_post_carrier, .fexEx_carrier, .dhl_carrier, .nationex_carrier, .canpar_carrier, .loomis_express_carrier, .gls_carrier {
            animation: scaleG 24s 0.5s linear infinite;
            transform: scale(0.65);
            transform-box: fill-box;
            transform-origin: center;
        }
        
        .canada_post_carrier {
            animation-delay: 3s;
        }
        .fexEx_carrier {
            animation-delay: 5.5s;
        }
        .dhl_carrier {
            animation-delay: 8s;
        }
        .nationex_carrier {
            animation-delay: 12.5s;
        }
        .canpar_carrier {
            animation-delay: 15s;
        }
        .loomis_express_carrier {
            animation-delay: 17.5s;
        }
        .gls_carrier {
            animation-delay: 20s;
        }
        
        @keyframes scaleG {
            0% {
                transform: scale(0.65);
                filter: drop-shadow(0px 0px 0px rgb(0 0 0 / 0));
            }
            7% {
                filter: drop-shadow(0px 0px 0px rgb(0 0 0 / 0));
                transform: scale(0.65);
            }
            8.5% {
                transform: scale(1);
            }
            16.5% {
                filter: drop-shadow(10px 10px 10px rgb(0 0 0 / 0.1));
                transform: scale(1);
            }
            18% {
                filter: drop-shadow(0px 0px 0px rgb(0 0 0 / 0));
                transform: scale(0.65);
            }
            100% {
                filter: drop-shadow(0px 0px 0px rgb(0 0 0 / 0));
                transform: scale(0.65);
            }
        }
         
        .inner_eleme g {
            animation: scaleOpacity 24s 0.5s linear infinite;
            opacity: 0.5;
        }
        
        .canada_post_carrier g {
            animation-delay: 3s;
        }
        
        .fexEx_carrier g {
            animation-delay: 5.5s;
        }
        
        .dhl_carrier g {
            animation-delay: 8s;
        }
    
        .nationex_carrier g {
            animation-delay: 12.5s;
        }
        
        .canpar_carrier g {
            animation-delay: 15s;
        }
        
        .loomis_express_carrier g {
            animation-delay: 17.5s;
        }
        
        .gls_carrier g {
            animation-delay: 20s;
        }
        
        @keyframes scaleOpacity {
            0% {
                opacity: 0.5;
            }
            7% {
                opacity: 0.5;
            }
            8.5% {
                opacity: 1;
            }
            16.5% {
                opacity: 1;
            }
            18% {
                opacity: 0.5;
            }
            100% {
                opacity: 0.5;
            }
        }
    
        .rect_width_update, .rect_width_update2 {
            animation: scaleRectElem 24s 0s linear infinite;
        }
        .rect_width_update2 {
            animation-delay: 12s;
        }
    
        @keyframes scaleRectElem {
            0% {
                width: 353px;
                transform: translate(574px, 131px);
            }
            10% {
                width: 353px;
                transform: translate(574px, 131px);
            }
            10.01% {
                width: 481px;
                transform: translate(511px, 131px);
            }
            50% {
                width: 481px;
                transform: translate(511px, 131px);
            }
            50.001% {
                width: 353px;
                transform: translate(574px, 131px);
            }
        }
        .inner_eleme {
            animation: transformRectElem 24s linear infinite;
            transform: translateX(100%);
        }
        .purolator_carrier .inner_eleme {
            animation-delay: 0s;
        }
        .canada_post_carrier .inner_eleme {
            animation-delay: 0.3s;
        }
        .fexEx_carrier .inner_eleme {
            animation-delay: 0.6s;
        }
        .dhl_carrier .inner_eleme {
            animation-delay: 0.9s;
        }
    
        .nationex_carrier .inner_eleme {
            animation-delay: 12s;   
        }
        .canpar_carrier .inner_eleme {
            animation-delay: 12.3s;   
        }
        .loomis_express_carrier .inner_eleme {
            animation-delay: 12.6s;   
        }
        .gls_carrier .inner_eleme {
            animation-delay: 12.9s;   
        }
    
        @keyframes transformRectElem {
            0% {
                transform: translateX(100%);
            }
            7% {
                transform: translateX(0%);
            }
            50% {
                transform: translateX(0%);
            }
            60% {
                transform: translate(-100%);
                opacity: 1;
            }
            60.01%{
                opacity: 0;
            }
            99.99% {
                transform: translate(100%);
                opacity: 0;
            }
            100%{
                opacity: 1;
            }
        }
    
    
        .blink_circle {
            animation: blinkCircle 2s 4s linear infinite;
            transform: scale(0);
            transform-origin: center;
            transform-box: fill-box;
        }
        .blink_duration1 {
            animation-delay: 4.5s;
        }
        .blink_duration2 {
            animation-delay: 5.5s;
        }
        
        @keyframes blinkCircle {
            0% {
                transform: scale(0);
                opacity: 0;
            }
            10% {
                opacity: 1;
            }
            20% {
                transform: scale(1.5);
                opacity: 0;
            }
            100% {
                transform: scale(1.5);
                opacity: 0;
            }
        }
        .blink_circle2 {
            animation: blinkCircle2 2s 4s linear infinite;
            transform: scale(0);
            transform-origin: center;
            transform-box: fill-box;
        }
        
        @keyframes blinkCircle2 {
            0% {
                transform: scale(0);
                opacity: 0;
            }
            20% {
                opacity: 1;
            }
            30% {
                transform: scale(2.2);
                opacity: 0;
            }
            100% {
                transform: scale(2.2);
                opacity: 0;
            }
        }
        
        .dicount_star_element {
            animation: blastDiscount 24s 1.4s linear infinite;
            transform: translate(60px, 810px);
            transform-origin: center;
            transform-box: fill-box;
        }
        .animation_delay3 {
            animation: blastDiscount1 24s 1.7s linear infinite;
        }
        .animation_delay2 {
            animation-delay: 3.2s;
        }
        .animation_delay3 {
            animation-delay: 4.2s;
        }
        .animation_delay5 {
            animation-delay: 7.4s;
        }
        .animation_delay4 {
            animation-delay: 5s;
        }    
        .animation_delay6, .animation_delay7  {
            animation: blastDiscount2 24s 1.7s linear infinite;
        }    
        .animation_delay7 {
            animation-delay: 5s;
        }
    
    
        /* second bubble */
    
        .animation_delay00 {
            animation-delay: 12.7s;
        }
        .animation_delay22 {
            animation-delay: 14.2s;
        }
        .animation_delay55 {
            animation-delay: 18.4s;
        }
        .animation_delay44 {
            animation-delay: 16s;
        }  
    
    
        @keyframes blastDiscount {
            0% {
                transform: translate(50px, 810px) scale(0.8);
            }
            24% {
                transform: translate(50px, 300px) scale(1);
                opacity: 1;
            }
            28% {
                transform: translate(50px, 240px) scale(1);
                opacity: 0;
            }
            100% {
                transform: translate(50px, 0px) scale(1.2);
                opacity: 0;
            }
        }
        
        @keyframes blastDiscount1 {
            0% {
                transform: translate(350px, 475px) scale(0.8);
            }
            24% {
                transform: translate(350px, 200px) scale(1);
                opacity: 1;
            }
            28% {
                transform: translate(350px, 160px) scale(1);
                opacity: 0;
            }
            100% {
                transform: translate(350px, 0px) scale(1.2);
                opacity: 0;
            }
        }
        
        @keyframes blastDiscount2 {
            0% {
                transform: translate(750px, 350px) scale(0.8);
            }
            24% {
                transform: translate(750px, -50px) scale(1);
                opacity: 1;
            }
            28% {
                transform: translate(750px, -90px) scale(1);
                opacity: 0;
            }
            100% {
                transform: translate(750px, -200px) scale(1.2);
                opacity: 0;
            }
        }
        
        
        .wing_delay1 {
            animation: wing_delay1 4s 1.5s linear infinite;
            opacity: 0;
        }
        .wing_delay2 {
            animation: wing_delay2 4s 1.5s linear infinite;
            opacity: 0;
        }
        
        
        @keyframes wing_delay1 {
            0% {
                opacity: 0;
            }
            10% {
                opacity: 1;
            }
            80% {
                opacity: 1;
            }
            100% {
                opacity: 0;

            }
            40% {

            }
            60% {
                opacity: 1;
            }
            100% {
                opacity: 0;
            }
        }
    
        .location {
            animation: movement 20s 0s linear infinite;
            transform: translate(580px, 40px) scale(1);
        }
        .location_delay_alternate {
            transform: translate(17%, 30%);
        }

        @keyframes rotateStrokAni {
            0% {
                stroke-dasharray: 0 100% 0 100%;
                opacity: 0;
            }
            1% {
                opacity: 1;
            }
            10% {
                stroke-dasharray:  0 0 70% 0;
            }
            14% {
                stroke-dasharray:  0 0 0 70%;
                opacity: 1;
            }
            14.001% {
                opacity: 0;
            }
            14.002% {
                opacity: 1;
                stroke-dasharray: 0 100% 0 100%;
            }
            26% {
                stroke-dasharray: 0 0% 70% 0%;
            }
            31% {
                stroke-dasharray: 0 0% 0% 70%;
                opacity: 1;
            }
            31.001% {
                opacity: 0;
            }
            31.002% {
                opacity: 1;
                stroke-dasharray: 0 100% 0 100%;
            }
            41% {
                stroke-dasharray:  0 0 70% 0;
            }
            44% {
                stroke-dasharray:  0 0 0 70%;
                opacity: 1;
            }
            44.001% {
                opacity: 0;
            }
            100% {
                stroke-dasharray: 0 100% 0 100%;
                opacity: 0;
            }
        }
    
        @keyframes rotateStrokAni2 {

            1% {

            }
            14% {

                opacity: 1;

            }

            26% {

            }
            31% {
                stroke-dasharray: 0 70% 70% 30%;
                opacity: 1; 
            }
            32% {
                opacity: 0;
            }
            100% {
                opacity: 0;
            }
        }

            0% {
                transform: translate(600px, 130px) scale(1);
            }
            100% {
                transform: translate(-650px, 130px) scale(1);
            }
        }
    
        .background_map {
            animation: bgMap 20s linear infinite;
            transform: translateX(0%);
        }
        
        @keyframes bgMap {
            0% {
                transform: translateX(0%);
            }
            99.9999% {
                transform: translateX(116.2%);
            }
            100% {
                transform: translateX(0%);
            }
        }
        
        .front_map {
            animation: frontMap 20s linear infinite;
            transform: translate(-26%, 12%);
        }

            }
            99.9999% {

        .truck_animation {
            animation: truckAnimation 3s 2s ease-in-out infinite;
        }
        
        @keyframes truckAnimation {

            }

            }
            30.0001% {

            55% {

            100% {
                transform: translateX(0px);
            }

        }

        .restart_ani {
            animation: restartPrice 24s linear infinite;
            animation-delay: 4s;
            transform: translateY(0px);
        }
    
        @keyframes restartPrice {
            0% {
                transform: translateY(0px);
            }
            1.5% {

        .full_earth {

        g.actual_price {

    <script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/2.1.3/jquery.min.js"></script>
    
    <script>
    
    const discounts = [11.01, 9.84, 9.49, 8.19, 10.23, 11.58, 11.88, 12.88];
    const finalAmount = ["7.07", 8.23, 8.58, 9.88, 10.23, 11.58, 11.88, 12.88];
    let counter = 1;
    
    setTimeout(function () {
        $(document).ready(function () {
            $.fn.countDiscount = function () {
                if (counter === 8) {
                    counter = 0
                }
                $("#discount").text(discounts[counter]);
                $(".finalAmount").text(finalAmount[counter]);
                
                counter++;
    
                $(".counter").each(countUp);
                function countUp() {
                    var num = $(this).text();
                    var decimal = 0;
                    if (num.indexOf(".") > 0) {
                        decimal = num.toString().split(".")[1].length;
                    }
                    $(this)
                        .prop("Counter", 0.0)
                        .animate(
                            {
                                Counter: $(this).text()
                            },
                            {
                                duration: 1200,
                                easing: "swing",
                                step: function (now) {
                                    $(this).text(parseFloat(now).toFixed(decimal));
                                }
                            }
                        );
                }
            }
            $.fn.countDiscount();
        });
        setInterval(function () {
            $.fn.countDiscount();
        }, 3000);
    }, 4000);
</script>
